import React, { PureComponent } from 'react';
import ResponsiveContainer from "react-responsive-widget";
import './App.css';
import {
    Label, LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, ReferenceArea
} from 'recharts';

const data = [
    { name: "Noir", chat: 2, chien : 3},
    { name: "Gris", chat: 6, chien : 3},
    { name: "Blanc", chat: 2, chien : 3},
    { name: "Brun", chat: 3, chien : 3},
    { name: "Gold", chat: 5, chien : 3},
  ];
  


export default class Ventes2 extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/ucdl/2yr7e4a5/5/';

  render() {

    return (
  
            <LineChart
              width={400}
              height={200}
              data={data}
            >
              <CartesianGrid strokeDasharray="3 3"/>
              <XAxis 
                allowDataOverflow={true}
                dataKey="name"
            
              />
              <YAxis 
              orientation="right"
                allowDataOverflow={true}
                type="number"
                yAxisId="1"
               />
              <YAxis 
                orientation="left"
                allowDataOverflow={true}
                type="number"
                yAxisId="2"
               /> 
              <Tooltip/>
              <Line yAxisId="1" type='natural' dataKey='chat' stroke='blue' animationDuration={300}/>
              <Line yAxisId="1" type='natural' dataKey='chien' stroke='red' animationDuration={300}/>
              
            </LineChart> 

      );
    }
  }
